package PracticeSession;

public class NestedPractice {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int r=1; r<=4; r++ )
		{
			for(int c=1; c<=2; c++)
			{
				System.out.print("Row no.="+r+" Col No.="+c+"");
			}
			
			
			System.out.println();
		}

	}

}
